var cv = require('opencv'); //opencv bindings
var gm = require('gm').subClass({imageMagick: true});; //graphicsmagick
var fs = require('fs'); //File System
var crypto = require('crypto'); //Used for hashing filename


function recognizeFace(base64_image, imageformat, lable, callback){
		console.log("SERVER LOG: Check tmp path exist");
		var tmpPath = './facerec/temp/';
		if(!fs.existsSync(tmpPath)) {
			fs.mkdirSync(tmpPath);
		}
		var imageFileLocation = tmpPath + hashFilename();
		fs.writeFile(imageFileLocation +'.'+ imageformat, base64_image, 'base64', function(err){
			if(err) {
				console.log('error: >> ' + err);
				return callback(err, null);
			}
			var imagePgmFile = imageFileLocation + '.pgm';

			gm(imageFileLocation +'.'+ imageformat)
				.setFormat('pgm')
				.resize(92, 112, "!")
				.write(imagePgmFile, function(err){
					if(err) {
						console.log('error: >>> ' + err);
						return callback(err, null);
					}
					lbphFaceRecognizer.loadSync('./facerec/trainingdata/person01/4e165c997c5b52d5db881eb75d014743a3809cf4.xml');
					lbphFaceRecognizer.loadSync('./facerec/trainingdata/person01/8c574ece2482b79f396ce300cd6b948c7e87daec.xml');
					lbphFaceRecognizer.loadSync('./facerec/trainingdata/person01/da1cb75b9e6924803b301921873f23b3fee5886f.xml');
					
					eigenFaceRecognizer.loadSync('./facerec/trainingdata/person01/5e0454420338d4579f2e193b57c43b83e979aaa7.xml');
					eigenFaceRecognizer.loadSync('./facerec/trainingdata/person01/c395cdd4fcc055eb12eecbcd7102da9e56b420cc.xml');
					eigenFaceRecognizer.loadSync('./facerec/trainingdata/person01/f341cc0e2b08c94a1b418f59b4213ca2c7be705d.xml');

					cv.readImage(imagePgmFile, function(err, im){
						if(err) {
							console.log('error: |> ' + err);
							return callback(err, null); 
						}
						var lbphR = lbphFaceRecognizer.predictSync(im);
						lbphR['name'] = lable;
						var eigenR = eigenFaceRecognizer.predictSync(im);
						eigenR['name'] = lable;
						callback(err, lbphR, eigenR);
					});
				});
		});
}


function trainFace(base64_image, imageformat, personname, callback)
{
	console.log("SERVER LOG: Hashing Filename");
	err = null;
	var personImageFolderPath = './facerec/faces/person01';
	if(!fs.existsSync(personImageFolderPath))
	{
		fs.mkdirSync(personImageFolderPath);
	}
	var imageFileNameWithoutExt = hashFilename();
	var imageFileLocation = personImageFolderPath + '/' + imageFileNameWithoutExt;
	var imageFile = imageFileLocation +'.'+ imageformat
	fs.writeFile(imageFile, base64_image, 'base64', function(err){
		if(err) {
			return callback(err); 
		}

		imagePgmFile = imageFile.replace(/\.[^/.]+$/, ".pgm");
		console.log(imagePgmFile);
		gm(imageFile)
			.setFormat('pgm')
			.resize(92, 112, "!")
			.write(imagePgmFile, function(err){
					if(err){
						return callback(err);
					}
					var n = new Date().toISOString();
					var	faceDataDirectory = './facerec/trainingdata/person01/';
					if(!fs.existsSync(faceDataDirectory)) {
						fs.mkdir(faceDataDirectory);
					}
					//trainingData.push([parseInt(faces[i].PersonId), faces[i].pgm_path]);
					var trainingData = [[1234,imagePgmFile]]
					
					console.log("SERVER LOG: Creating lbphface training data.");

					var shasum = crypto.createHash('sha1');	
					var hash_fname_lb = shasum.update(n+'_l').digest('hex') + '.xml';
					lbphFaceRecognizer.trainSync(trainingData);
					lbphFaceRecognizer.saveSync(faceDataDirectory + hash_fname_lb);
					console.log('lbphFaceRecognizer Saved!');
						
					var shasum = crypto.createHash('sha1');
					hash_fname_ei = shasum.update(n+'_e').digest('hex') + '.xml';
				    eigenFaceRecognizer.trainSync(trainingData);
				    eigenFaceRecognizer.saveSync(faceDataDirectory + hash_fname_ei);
				    console.log('eigenFaceRecognizer Saved!');

					//console.log("SERVER LOG: Creating Fisherface training data.");
					shasum = crypto.createHash('sha1');
					hash_fname_fi = shasum.update(n+'_f').digest('hex') + '.xml';
				    // fisherFaceRecognizer.trainSync(trainingData);
				    // fisherFaceRecognizer.saveSync(faceDataDirectory + hash_fname_fi);
				    // console.log('fisherFaceRecognizer Saved!');

				    var x = {
						EigenFace_path:faceDataDirectory + hash_fname_ei,
						// FisherFace_path:faceDataDirectory + hash_fname_fi,
						LBPHFace_path:faceDataDirectory + hash_fname_lb,
						lable:personname
					};
					callback(null,x);
			});
	});
}


//Hashing Filename using date
function hashFilename()
{
	var date = new Date();
	var isoDate = date.toISOString();
	var shasum = crypto.createHash('sha1');
	return shasum.update(isoDate).digest('hex');
}


